import React, {Component} from 'react';
import {Link} from 'react-router-dom';
import axios from 'axios';
import Carousel from 'react-bootstrap/Carousel'
import welcome from '../Files/welcome.png'
import topuser from '../Files/topuser.png'
import usercount from '../Files/usercount.png'
import { lightGreen } from '@material-ui/core/colors';


class Frontpage extends Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <Carousel style={{textAlign:"center", backgroundColor:lightGreen}}>
                <Carousel.Item>
                    <img
                    className="d-block w-100"
                    src={welcome}
                    />
                </Carousel.Item>
                <Carousel.Item>
                    <img
                        className="d-block w-100"
                        src={topuser}
                    />
                </Carousel.Item>
                <Carousel.Item>
                    <img
                        className="d-block w-100"
                        src={usercount}
                    />
                    <Carousel.Caption>
                        <Link to={`/signup`}><h1>Join us today!</h1></Link>
                    </Carousel.Caption>
                </Carousel.Item>
            </Carousel>
        )
    }
}

export default Frontpage;
